const Home = () => {

    const handleClick = () => {
        console.log('hello');
    }

    const handleClickAgain = (name, e) => {
        console.log('hello ' + name, e.target);
    }

    return ( 
        <div className="home">
            <h2>Homepage</h2>
            <button onClick={handleClick}>Click me</button>
            <button onClick= {() => handleClickAgain('mario', e)}>Click me again</button>
        </div>
     );
}
 
export default Home;
